 const JeRaliseMesRves_MaDUCATI = "{\"parsed\":{\"_path\":\"/blog/je-ralise-mes-rves-ma-ducati\",\"_dir\":\"blog\",\"_draft\":false,\"_partial\":false,\"_locale\":\"\",\"title\":\"Je réalise mes rêves : ma DUCATI\",\"description\":\"Je viens de la rencontrer en personne, on s'était longtemps vu au loin, jamais en pleine lumière. Sans le savoir j'étais séduit, était-ce à cause de son ami qui me vendait ses mérites et ses qualités à chaque fois qu'on s'en approchait ? Je ne sais pas je ne sais plus.\\nJe suis perdu ou peut-être trouvé.\",\"permalink\":\"je-realise-mes-reves-ducati\",\"author\":\"macojaune\",\"date\":\"2024-06-24T21:17:42.898Z\",\"updatedAt\":\"2024-06-24T21:45:24.696Z\",\"layout\":\"post\",\"image\":\"/pictures/monsterYellow.jpg\",\"draft\":true,\"categories\":[\"Lifestyle\",\"JauneVie\"],\"tags\":[\"lifestyle\",\"bikelife\",\"moto\"],\"body\":{\"type\":\"root\",\"children\":[{\"type\":\"element\",\"tag\":\"p\",\"props\":{},\"children\":[{\"type\":\"text\",\"value\":\"Je viens de la rencontrer en personne, on s'était longtemps vu au loin, jamais en pleine lumière. Sans le savoir j'étais séduit, était-ce à cause de son ami qui me vendait ses mérites et ses qualités à chaque fois qu'on s'en approchait ? Je ne sais pas je ne sais plus.\\nJe suis perdu ou peut-être trouvé.\"}]},{\"type\":\"element\",\"tag\":\"p\",\"props\":{},\"children\":[{\"type\":\"text\",\"value\":\"J'en ai longtemps rêvé et jamais je n'aurais pensé que ces rêves deviendraient aussi vite réalité.\\nQu'est-ce qui a changé ? Je l'ai juste décidé.\"}]},{\"type\":\"element\",\"tag\":\"p\",\"props\":{},\"children\":[{\"type\":\"text\",\"value\":\"Suite à une série d'audios, j'ai fait la liste de mes objectifs et je les ai classés par ordre de faisabilité dans les 6mois.\"}]},{\"type\":\"element\",\"tag\":\"p\",\"props\":{},\"children\":[{\"type\":\"text\",\"value\":\"Le premier de la liste fut : Acheter ma moto.\"}]},{\"type\":\"element\",\"tag\":\"p\",\"props\":{},\"children\":[{\"type\":\"text\",\"value\":\"Notez la présence du pronom possessif et vous comprendrez qu'elle était déjà mienne avant même que j'en sois au courant, ou même que je la rencontre.\"}]},{\"type\":\"element\",\"tag\":\"p\",\"props\":{},\"children\":[{\"type\":\"text\",\"value\":\"À partir de ce moment ma routine mentale quotidienne s'est transformée en «Penser à mon objectif et à ce que je vais ressentir une fois atteint le plus souvent et le plus longtemps possible»\"}]},{\"type\":\"element\",\"tag\":\"p\",\"props\":{},\"children\":[{\"type\":\"text\",\"value\":\"Tout s'est ensuite enchainé à une vitesse incroyable. On aime ça la vitesse, non ?\\nLes vidéos youtube se sont enchainées, les fonds d'écrans ont changé de registre, la tête a recommencé à se tourner au passage des machines à décibels.\\nMon esprit était concentré. Je me sentais bien, j'avais l'impression d'être déjà cet heureux propriétaire qui vous écrit actuellement et ça c'est une des clés qui change la donne.\"}]},{\"type\":\"element\",\"tag\":\"p\",\"props\":{},\"children\":[{\"type\":\"text\",\"value\":\"Prochaine étape, rajouter les magasins de moto à mon itinéraire, passer devant 1 puis 2 puis 3 fois, oser rentrer regarder, se faire recevoir comme une merde dans l'un puis le rayer de la liste, passer dans l'autre et se faire attraper par un commercial très virulent ! Énergique, un peu brusque mais le courant est passé. On discute, on échange, il cherche à me vendre un modèle \\\"ridicule\\\" selon moi (je n'ai rien contre les demoiselles qui roulent en mt-07, c'est de l'humour les gars doucement…), mes yeux sont déja tombés sur le modèle qui a fait chavirer mon coeur. Devinez de quelle couleur ? Oui vous l'aurez compris. Jaune.\"}]},{\"type\":\"element\",\"tag\":\"p\",\"props\":{},\"children\":[{\"type\":\"element\",\"tag\":\"img\",\"props\":{\"alt\":\"\",\"src\":\"/pictures/monsterYellow.jpg\"},\"children\":[]}]},{\"type\":\"element\",\"tag\":\"p\",\"props\":{},\"children\":[{\"type\":\"text\",\"value\":\"Mon choix est fait, je ne suis toujours pas acheteur pour autant, ma réflexion s'intensifie, mes doutes arrivent et perturbent ma vision.\\nIls chuchotent à propos du prix, du neuf, de l'entretien, des factures, des dettes, des projets. C'est un achat égoïste qu'ils disent. Penses un peu aux autres qu'ils disent.\\nTaisez-vous ! J'ai longtemps rêvé de ce moment. Il est la. Je ne vous laisserais pas l'emporter.\"}]},{\"type\":\"element\",\"tag\":\"p\",\"props\":{},\"children\":[{\"type\":\"text\",\"value\":\"Allons-y, n'en parlons à personne. Qu'est-ce qui peut arriver de pire ?\"}]}],\"toc\":{\"title\":\"\",\"searchDepth\":2,\"depth\":2,\"links\":[]}},\"_type\":\"markdown\",\"_id\":\"content:blog:Je-ralise-mes-rves--ma-DUCATI.md\",\"_source\":\"content\",\"_file\":\"blog/Je-ralise-mes-rves--ma-DUCATI.md\",\"_stem\":\"blog/Je-ralise-mes-rves--ma-DUCATI\",\"_extension\":\"md\"},\"hash\":\"nkkx1Mi4pY\"}";

